import {Link} from 'react-router-dom';

function Home() {
    return (
        <div style={{padding: '2rem', textAlign: 'center' }}>
            <h1> Centro Bus Predictor</h1>
            <p style = {{ fontSize: '1.1rem', margin: '1rem 0' }}>
                Track Campus buses in real-time. Built for SUNY Oswego Students, By Students.
            </p>
            <Link to="/tracker">
            <button style={{
                padding: '0.75rem 1.5rem', backgroundColor: '#004b23', color: '#fff', border: 'none', borderRadius: '8px', fontSize: '1rem', cursor: 'pointer' 
            }}>
                Go to live Tracker
            </button>
            </Link>
        </div>

    )
}
export default Home;
